class CoffeeMachine {
  constructor() {
    this.state = 'init';
    this.leftMilk = '500ml';
  }

  // \u7F8E\u5F0F
  american() {
    // \u5C1D\u8BD5\u5728\u884C\u4E3A\u51FD\u6570\u91CC\u62FF\u5230\u5496\u5561\u673A\u5B9E\u4F8B\u7684\u4FE1\u606F\u5E76\u8F93\u51FA
    console.log('\u5496\u5561\u673A\u73B0\u5728\u7684\u725B\u5976\u5B58\u50A8\u91CF\u662F:', this.leftMilk);
    console.log('\u6211\u53EA\u5410\u9ED1\u5496\u5561');
    return '\u7F8E\u5F0F';
  }

  // \u666E\u901A\u62FF\u94C1
  latte() {
    this.american();
    console.log('\u52A0\u70B9\u5976');
    return '\u666E\u901A\u62FF\u94C1';
  }

  // \u9999\u8349\u62FF\u94C1
  vanillaLatte() {
    this.latte();
    console.log('\u518D\u52A0\u9999\u8349\u7CD6\u6D46');
    return '\u9999\u8349\u62FF\u94C1';
  }

  // \u6469\u5361
  mocha() {
    this.latte();
    console.log('\u518D\u52A0\u5DE7\u514B\u529B');
    return '\u6469\u5361';
  }

  changeState(state) {
    this.state = state;
    if (!this[state]) {
      return;
    }
    return this[state]();
  }
}

const mk = new CoffeeMachine();

export default () => <div>\u5496\u5561\u7C7B\u578B\uFF1A{mk.changeState('mocha')}</div>;
