// \u65F6\u949F\u7EC4\u4EF6
const MajorClock = ({ ms = 0 }) => {
  const ms2Time = (milliseconds = 0) => {
    let time = milliseconds;
    const ms = milliseconds % 1000;
    time = (milliseconds - ms) / 1000;
    const seconds = time % 60;
    time = (time - seconds) / 60;
    const minutes = time % 60;
    const hours = (time - minutes) / 60;

    const result = hours + ':' + minutes + ':' + seconds + '.' + ms;
    return result;
  };

  return <h1 style={{ textAlign: 'center', color: 'red' }}>{ms2Time(ms)}</h1>;
};

// \u8FD4\u56DE\u6240\u6709\u8BB0\u6B21jsx
const SplitTimes = ({ list = [] }) => {
  return list.map((v, k) => <MajorClock key={k} ms={v} />);
};

// \u6309\u94AE\u7EC4\u4EF6
const ControlButton = ({
  children,
  type,
  activated,
  onStart,
  onPause,
  onSplit,
  onReset,
}) => {
  const BTN_COLORS = new Map([
    ['danger', 'red'],
    ['primary', 'blue'],
    ['warn', 'yellow'],
    ['normal', '#aaa'],
  ]);

  const contStyle = {
    display: 'flex',
    justifyContent: 'space-around',
  };

  const btnStyle = {
    width: '64px',
    height: '64px',
    lineHeight: '64px',
    textAlign: 'center',
    fontWeight: '300',
    borderRadius: '99px',
    border: '3px solid #b4a078',
  };

  if (activated) {
    return (
      <div style={contStyle}>
        <button style={btnStyle} onClick={onSplit}>
          \u8BA1\u6B21
        </button>
        <button style={btnStyle} onClick={onPause}>
          \u505C\u6B62
        </button>
      </div>
    );
  } else {
    return (
      <div style={contStyle}>
        <button style={btnStyle} onClick={onReset}>
          \u590D\u4F4D
        </button>
        <button style={btnStyle} onClick={onStart}>
          \u542F\u52A8
        </button>
      </div>
    );
  }
};

export default class StopWatch extends React.Component {
  constructor() {
    super(...arguments);
  }

  state = {
    isStarted: false,
    startTime: 0,
    currentTime: 0,
    splits: [],
  };

  render() {
    const { isStarted, splits, currentTime, startTime } = this.state;

    return (
      <React.Fragment>
        <h2 style={{ textAlign: 'center', color: 'green' }}>\u79D2\u8868</h2>
        <MajorClock ms={currentTime - startTime} />
        <ControlButton
          activated={isStarted}
          onStart={() => {
            this.setState({
              isStarted: true,
              startTime: new Date(),
              currentTime: new Date(),
            });

            this.intervalHandle = setInterval(() => {
              this.setState({ currentTime: new Date() });
            }, 1000 / 60);
          }}
          onPause={() => {
            clearInterval(this.intervalHandle);
            this.setState({
              isStarted: false,
            });
          }}
          onReset={() => {
            this.setState({
              startTime: null,
              currentTime: null,
              splits: [],
            });
          }}
          onSplit={() => {
            this.setState({
              splits: [...splits, currentTime - startTime],
            });
          }}
        />
        <SplitTimes list={splits} />
      </React.Fragment>
    );
  }
}
