for (var i = 0; i < btns.length; i++) {
  btns[i].onclick = function () {
    if (this.className == 'showBtn') {
      return;
    }
    var myIndex = parseInt(this.getAttribute('index'));
    var leng = -200 * (myIndex - dot);
    animate(leng);
    dot = myIndex;
    showBtn();
  };
}
